import React, { useState } from "react";
import "./index.css";
const App = ()=>{


    var gettime = new Date().toLocaleTimeString();
    const [getCtime,setCtime] = useState(gettime);

    const updateTime = ()=>{
        gettime = new Date().toLocaleTimeString();
        setCtime(gettime);
    }

    setInterval(updateTime,1000);

    return(
        <>
            <div>
                <h1>{gettime}</h1>
            </div>
        </>
    )
};

export default App;
